const ctxBar = document.getElementById('potenciaChart').getContext('2d');

// Plugin para dibujar texto en el gráfico
const noDataPlugin = {
    id: 'noDataPlugin',
    afterDatasetsDraw: (chart) => {
        const ctx = chart.ctx;
        chart.data.datasets.forEach((dataset, datasetIndex) => {
            const meta = chart.getDatasetMeta(datasetIndex);
            meta.data.forEach((bar, index) => {
                if (dataset.data[index] === 'N/A') {
                    const position = bar.tooltipPosition();
                    ctx.fillStyle = 'red'; // Color del texto
                    ctx.textAlign = 'center';
                    ctx.textBaseline = 'middle';
                    ctx.fillText('N/A', position.x, position.y - 10);
                }
            });
        });
    }
};

