function limpiarDatos() {
    document.getElementById("medidor").value = "";
    const meses = ["enero", "febrero", "marzo", "abril", "mayo", "junio", "julio", "agosto", "septiembre", "octubre", "noviembre", "diciembre"];
    meses.forEach((mes, index) => {
        document.getElementById(`energia_${mes}`).innerText = "";
        document.getElementById(`potenciaAdq_${mes}`).innerText = "";
        document.getElementById(`potenciaCont_${mes}`).innerText = "";
        document.getElementById(`monto_${mes}`).innerText = "";

        // Limpiar datos del gráfico
        potenciaChart.data.datasets[0].data[index] = null;
        potenciaChart.data.datasets[1].data[index] = null;
        lineChart.data.datasets[0].data[index] = null;
        lineChart.data.datasets[1].data[index] = null;
    });

    potenciaChart.update();
    lineChart.update();
}
